import React from 'react';
import classes from './Menu.module.css';

const Menu =()=> {
    return (
       <nav className={classes.nav_menu}>
           <a href="#">Accueil</a>
           <a href="#information">A propos de moi</a>
           <a href="#projects">Projets</a>
           <a href="#contact">Contact</a>
        </nav>
    );
}

export default Menu;
